import React from 'react';

function Animation(){
    return (
        <div className="animation-background">
            <img src="./assets/explode.02.png"></img>
            <div className='animation-div'>
                <div className="bam">
                    <h2>BAM!!!</h2>
                </div>
                <div  className="thomp">
                    <h2>THUMP!!</h2>
                </div>
                <div className="pow">
                    <h2>POW!</h2>
                </div>
            </div>
        </div>
    )
}

export default Animation;
